import React from "react";
import styles from "./App.module.css";

import BusinessList from "../BusinessList/BusinessList";
import SearchBar from "../SearchBar/SearchBar";



function App() {
  const businesses = [
    {
      id: 1,
      name: "Business 1",
      address: "123 Main St",
      city: "City 1",
      state: "State 1",
      zipCode: "12345",
      category: "Category 1",
      rating: 4.5,
      reviewCount: 100,
      imageUrl: "https://example.com/business1.jpg"
    },
    {
      id: 2,
      name: "Business 2",
      address: "456 Elm St",
      city: "City 2",
      state: "State 2",
      zipCode: "67890",
      category: "Category 2",
      rating: 3.8,
      reviewCount: 75,
      imageUrl: "https://example.com/business2.jpg"
    },
    // Add more businesses here...
  ];

  return (
    <div className={styles.App}>
      <h1>ravenous</h1>
      <SearchBar />
      <BusinessList businesses={businesses} />
    </div>
  );
};

export default App;
